import * as React from "react";
import Avatar from "@mui/material/Avatar";
import Button from "@mui/material/Button";
import CssBaseline from "@mui/material/CssBaseline";
import TextField from "@mui/material/TextField";
import FormControlLabel from "@mui/material/FormControlLabel";
import Checkbox from "@mui/material/Checkbox";
import { Link } from "react-router-dom";
import Grid from "@mui/material/Grid";
import Box from "@mui/material/Box";
import LockOutlinedIcon from "@mui/icons-material/LockOutlined";
import Typography from "@mui/material/Typography";
import Container from "@mui/material/Container";
import { createTheme, ThemeProvider } from "@mui/material/styles";
import { useForm } from "react-hook-form";
import { useState, useEffect } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import Snackbar from "../Components/Snackbar";

const defaultTheme = createTheme();

export default function SignIn() {
  const location = useLocation();
  const [isRedirected, setIsRedirected] = useState(false);
  // const [isLoggedIn, setIsLoggedIn] = useState(false);
  const navigate = useNavigate();

  const {
    register,
    handleSubmit,
    setError,
    formState: { errors, isSubmitting },
  } = useForm();

  const onSubmit = async (data) => {
    // await new Promise((resolve) => setTimeout(resolve, 1000));
    // try {
    //   const formData = data;
    //   formData.password = encrypt(data);
    //   const encryptedData = { ...formData };
    //   console.log(encryptedData);
    //   const users = JSON.parse(localStorage.getItem("users"));
    //   users.forEach((element) => {
    //     console.log("elements", element);
    //     if (JSON.stringify(element) === JSON.stringify(encryptedData)) {
    //       console.log("in If");
    //       sessionStorage.setItem("token", encryptedData.password);
    //       navigate("home", { state: { data: encryptedData } });
    //     }
    //   });
    //   console.log(encryptedData);
    //   console.log("invalid credentials");
    //   throw new Error();
    // } catch (error) {
    //   setError("root", {
    //     message: "No user found with this email or password",
    //   });
    // }
  };

  return (
    <>
      <ThemeProvider theme={defaultTheme}>
        <Container component="main" maxWidth="xs">
          <CssBaseline />
          <Box
            className="contact-form"
            sx={{
              marginTop: 8,
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
            }}
          >
            <Avatar alt="R" src="/static/images/avatar/1.jpg" sx={{ mt: 1 }} />
            <Typography component="h6" variant="h6">
              Upload Avatar
            </Typography>
            <Box
              component="form"
              onSubmit={handleSubmit(onSubmit)}
              noValidate
              sx={{ mt: 1 }}
            >
              <TextField
                {...register("name", {
                  required: "Name is required",
                })}
                margin="normal"
                required
                fullWidth
                name="name"
                label="Name"
                type="text"
                id="name"
                autoComplete="name"
                autoFocus
              />
              {errors.name && (
                <div className="error">{errors.name.message}</div>
              )}
              <TextField
                {...register("email", {
                  required: "email is required",
                  validate: (value) => {
                    if (!value.match(/^\S+@\S+\.\S+$/)) {
                      return " is invalid";
                    } else {
                      return true;
                    }
                  },
                })}
                margin="normal"
                fullWidth
                required
                id="email"
                label="Email Address"
                name="email"
              />
              {errors.email && (
                <div className="error">{errors.email.message}</div>
              )}
              <TextField
                {...register("password", {
                  required: "Password is required",
                })}
                margin="normal"
                required
                fullWidth
                name="password"
                label="Number"
                type="tel"
                id="password"
                autoComplete="current-password"
              />
              {errors.password && (
                <div className="error">{errors.password.message}</div>
              )}
              <Button
                className="add-contact"
                type="submit"
                fullWidth
                variant="contained"
                sx={{ mt: 3, mb: 2 }}
                disabled={isSubmitting}
              >
                {isSubmitting ? "Loading..." : "Add Contact"}
              </Button>
              {errors.root && (
                <div className="error">{errors.root.message}</div>
              )}
              <Button
                className="add-contact-cancel"
                type="reset"
                fullWidth
                variant="contained"
                sx={{ mb: 2 }}
                disabled={isSubmitting}
              >
                Cancel
              </Button>
            </Box>
          </Box>
        </Container>
      </ThemeProvider>
    </>
  );
}
